import React from 'react';
import { Container, Typography } from '@material-ui/core';
import NavBar from '../components/NavBarComponents/NavBar';
import Pomodoro from '../components/Timer/Pomodoro';

function TimerPage() {

    return (
        <Container>
            <Typography 
            variant='h3' 
            align='center'
            >
                Study Timer
            </Typography>
            <NavBar/>
            <Pomodoro/>
        </Container>

    )
}

export default TimerPage
